import "./Form.css";
const Form = () => {
  const handleSearch = () => {
    window.location.replace("/search");
  };
  return (
    <form className="search-form">
      <label>
        <i
          className="fa fa-bed"
          style={{ color: "#d6d6d6", marginRight: "5px" }}
        />
        Where are you going?
      </label>
      <input type="date" />
      <button className="button search-button" onClick={handleSearch}>
        Search
      </button>
    </form>
  );
};
export default Form;
